    "chinook-salmon-central-valley-spring-run-distribution-2005-ds982",nt"isopen":
    false,nt"url": null,nt"notes": "'CVSR_Chinook_Distribution_06_2005' depicts
    Chinook presence as well as habitat type and quality in the Central Valley Spring-run
    Evolutionary Significant Unit (ESU). The data was compiled by the National Marine
    Fisheries Service (NOAA Fisheries) Southwest Regional Office (SWR) in an effort
    to designate Critical Habitat for Chinook in California. The linework for this layer
    is based on the California Department of Fish and Game (CDFG) and Pacific States
    Marine Fisheries Commission (PSMFC) 1:100,000 scale stream based routed hydrography.
    SWR biologists divided the routed hydrography into stream segments using the best
    available information to represent local Chinook distribution and habitat. As a
    result, each segment has its own unique identifier (GIS_Link) and related presence
    and habitat information. The data set is in shapefile format and can be included
    as a map layer in a GIS. This data set is an update of 'CVSR_Chinook_Draft_2004'",nt"license_title":
